--emprestimo do 18 ao 6999










update emprestimo 
set data_dev = (data_emp+15);

CREATE OR REPLACE FUNCTION calculaMulta ()
RETURNS trigger AS $$
declare multacalc integer;
BEGIN
if new.data_devolvido > new.data_dev then
multacalc := (new.devolvido - new.dev)*2;
END if;
values (multacalc);
end;
$$ LANGUAGE plpgsql;

create trigger geramulta
after insert or update on emprestimo
for each row
execute procedure calculaMulta();
